DROP TABLE IF EXISTS `charging_standards`;
CREATE TABLE `charging_standards` (
  `charging_standards_id` varchar(100) NOT NULL COMMENT 'charging_standards_id 停车场收费标准id 数据库表 charging_standards 对应实体类 ChargingSandards 属性 chargingStandardsId; 属性类型String,数据库类型varchar 长度100 数据库中不自动初始化, 初始化时由调用ID生成器生成',
  `parking_info_id` varchar(100) NOT NULL COMMENT 'parking_info_id 停车费用标准对应停车场id 数据库表 charging_standards 对应实体类 ChargingSandards 属性 parkingInfoId; 属性类型String,数据库类型varchar 长度100 数据库中不自动初始化, 新建停车场信息时由调用生成器生成',
  `charging_standards_step` varchar(2) NOT NULL COMMENT 'charging_standards_step 停车费用标准j阶段取值 表示这是阶梯标准中的第几阶段 eg:  阶梯段停车费收取标准 0-60分钟为第一段,则该取值为 1       阶梯段停车费收取标准 61-120分钟为第一段,则该取值为 2       阶梯段停车费收取标准 121-180分钟为第一段,则该取值为 3 数据库表 charging_standards 对应实体类 ChargingSandards 属性 chargingStandardsStep; 属性类型 String,数据库类型 varchar 长度2 数据库中不自动初始化, 新建停车场信息时由设置生成',
  `charging_standards_step_start` varchar(5) NOT NULL COMMENT 'charging_standards_step_start 停车费用标准j阶段开始时间点(以分钟计) 表示这是阶梯标准中的第几阶段 eg:  阶梯段停车费收取标准 0-60分钟为第一段,则该值为0 数据库表 charging_standards 对应实体类 ChargingSandards 属性 chargingStandardsStepStart; 属性类型 String ,数据库类型 varchar 长度 5 数据库中不自动初始化, 新建停车场信息时由设置生成',
  `charging_standards_step_end` varchar(5) NOT NULL COMMENT 'charging_standards_step_end 停车费用标准j阶段结束时间点(以分钟计) 表示这是阶梯标准中的第几阶段 eg:  阶梯段停车费收取标准 0-60分钟为第一段则该值为60 数据库表 charging_standards 对应实体类 ChargingSandards 属性 chargingStandardsStepEnd; 属性类型 String ,数据库类型 varchar 长度 5 数据库中不自动初始化, 新建停车场信息时由设置生成',
  `charging_standards_prise` varchar(4) NOT NULL COMMENT 'charging_standards_prise 停车费用标准j阶段s收费标准 表示这是阶梯标准中的第几阶段 eg:  阶梯段停车费收取标准 0-60分钟为第一段, 收费标准为10元       则该值为10 数据库表 charging_standards 对应实体类 ChargingSandards 属性 chargingStandardsPrise; 属性类型 String ,数据库类型 varchar 长度 4 数据库中自动初始化为0 设计值为 000  代表 0.00元 使用时,先乘以系数100    将实际金额转换为绝对整数后,进行运算,在运算结束后再除以系数100将换算为实际金额 数据库中不自动初始化,,由设定停车场收费标准人员手工初始化',
  `charging_standards_state` varchar(50) NOT NULL DEFAULT 'enable' COMMENT 'charging_standards_state 停车费用标准j阶段s收费标准状态 表示这是阶梯标准中的第几阶段 数据库表 charging_standards 对应实体类 ChargingSandards 属性 chargingStandardsState; 属性类型 String ,数据库类型 varchar 长度7 两个状态值 enable    表示该车牌用户设置为活跃状态 disable    表示该车牌用户不希望使用 数据库中自动初始化为disable 初始化时由用户添加',
  `charging_standards_create_time` varchar(50) DEFAULT NULL COMMENT 'charging_standards_create_time 停车费用标准j阶段收费标准更改时间 表示这是阶梯标准中的第几阶段 数据库表 charging_standards 对应实体类 ChargingSandards 属性 chargingStandardsCreateTime; 属性类型 String ,数据库类型 varchar 长度 19 默认为当停车费用标准j阶段收费标准发生生变动时 系统自动从后台获取时间生成 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  `charging_standards_manager_type` varchar(50) DEFAULT NULL COMMENT 'charging_standards_manager_type 停车费用标准j阶段s收费标准更改人类型 表示这是阶梯标准中的第几阶段 数据库表 charging_standards 对应实体类 ChargingSandards 属性 chargingStandardsManagerType; 属性类型 String ,数据库类型 varchar 长度2 默认为 1 后台管理员 1    后台管理员 2    停车场场主管理员',
  `charging_standards_manager_id` varchar(50) DEFAULT NULL COMMENT 'charging_standards_manager_id 停车费用标准j阶段s收费标准更改动人员id 参照  charging_standards_manager_type 停车费用标准j阶段s收费标准更改人类型 当值 =1 时   为后台管理员id =2 时   为停车场场主管理员id 数据库表 charging_standards 对应实体类 ChargingSandards 属性 chargingStandardsManagerId 属性类型 String ,数据库类型 varchar 长度100 无默值 ,根据操作停车场收费标准信息时,获取操作人员id (新建停车场信息,也算操作,暂定为初始化操作)',
  PRIMARY KEY (`charging_standards_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='charging_standards 停车场收费标准 对应实体类 ChargingSandards  停车场景中停车场收费标准对应的模拟对象';

