CREATE TABLE `client_user` (
  `client_user_id` varchar(100) NOT NULL COMMENT 'client_user_id 汽车车主用户 id 数据库表 client_user 对应实体类 ClientUser 属性 clientUserId; 属性类型 String ,数据库类型 varchar 长度 100 数据库中不自动初始化, 用户新建账户时由调用生成器生成',
  `client_user_cellphone` varchar(12) NOT NULL COMMENT 'client_user_cellphone 汽车车主用户手机号 数据库表 client_user 对应实体类 ClientUser 属性 clientUserCellphone; 属性类型 String ,数据库类型 varchar 长度 12 默认为空,由用户填写初始化,不允许为空',
  `client_user_security` varchar(100) DEFAULT NULL COMMENT 'client_user_security 汽车车主用户安全识令牌 数据库表 client_user 对应实体类 ClientUser 属性 clientUserSecurity; 属性类型 String ,数据库类型 varchar 长度 100 用户注册成功后,由服务器发送到用户手机管理一份,中心服务器管理一份 关联服务 torken 服务器',
  `client_user_sex` varchar(6) DEFAULT NULL COMMENT 'client_user_sex 汽车车主用户安全识令牌 数据库表 client_user 对应实体类 ClientUser 属性 clientUserSex; 属性类型 String,数据库类型 varchar 长度 6 默认为空,由用户填写初始化,不允许为空',
  `client_user_nick_name` varchar(50) DEFAULT NULL COMMENT 'client_user_nick_name 汽车车主用户昵称 数据库表 client_user 对应实体类 ClientUser 属性 clientUserNickName 属性类型 String ,数据库类型 varchar 长度50 默认为空,由用户填写',
  `client_user_birthday` varchar(11) DEFAULT NULL COMMENT 'client_user_birthday 汽车车主用户生日 数据库表 client_user 对应实体类 ClientUser 属性 clientUserBirthday 属性类型 String ,数据库类型 varchar 长度10 默认为空,由用户填写 格式 YYYY-MM-DD 年-月-日 eg:1999-01-01',
  `client_user_sign_up_time` varchar(20) NOT NULL COMMENT 'client_user_sign_up_time 汽车车主用户注册日期 数据库表 client_user 对应实体类 ClientUser 属性 clientUserSignUpTime 属性类型 String ,数据库类型 varchar 长度20 默认为空,由用户填写 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  `client_user_active_mark` varchar(7) NOT NULL DEFAULT 'enable' COMMENT 'client_user_active_mark 汽车车主用户激活状态标记 数据库表 client_user 对应实体类 ClientUser 属性 clientUserActiveMark 属性类型 String ,数据库类型 varchar 长度7 默认为enable可用 enable可用 disable为不可用',
  `client_user_auto_pay` varchar(1) NOT NULL DEFAULT '0' COMMENT 'client_user_auto_pay 汽车车主用自动支付状态标记 数据库表 client_user 对应实体类 ClientUser 属性 clientUserActiveMark 属性类型 String ,数据库类型 varchar 长度7 默认为 0 不自动支付 0 不自动支付 1 自动支付',
  `client_user_registr_ation_id` varchar(100) DEFAULT NULL,
  `client_user_type` varchar(1) DEFAULT '1' COMMENT '1 android 0 ios',
  PRIMARY KEY (`client_user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='client_user 终端用户数据库表 对应实体类ClientUser 停车场景中车主对应的模拟对象';

