  `draw_cash_order_src_cust_id` varchar(50) NOT NULL COMMENT 'draw_cash_order_src_cust_id 提现订单业务发起者用户id 对应数据库 draw_cash_order 对应实体类 DrawCashOrder 对应属性 drawCashOrderSrcCustId 数据库字段类型 varchar 实体类字段类型 String 长度50',
  `draw_cash_order_2_fund_account_id` varchar(50) NOT NULL COMMENT 'draw_cash_order_2_fund_account_id 提现订单业务发起者用户对应资金管理账户 id 对应数据库 draw_cash_order 对应实体类 DrawCashOrder 对应属性 drawCashOrder2FundAccountId 数据库字段类型 varchar 实体类字段类型 String 长度50',
  `draw_cash_order_draw_cash_type` varchar(3) NOT NULL COMMENT 'draw_cash_order_draw_cash_type 用户提现资金去向类型 对应数据库 draw_cash_order 对应实体类 DrawCashOrder 对应属性 drawCashOrderDrawCashType 数据库字段类型 varchar 实体类字段类型 String 长度3 值  1  提现到支付宝账户 值  2  提现到支付宝账户 值  3  提现到银行卡账户 如有其它 在进行递增',
  `draw_cash_order_draw_cash_account_id` varchar(50) NOT NULL COMMENT 'draw_cash_order_draw_cash_account_id 用户提现资金去向账户id 对应数据库 draw_cash_order 对应实体类 DrawCashOrder 对应属性 drawCashOrderDrawCashAccountId 数据库字段类型 varchar 实体类字段类型 String 长度 50 取决判定 draw_cash_order_draw_cash_type 用户提现资金去向类型  如 draw_cash_order_draw_cash_type         值  1  提现到支付宝账户                 为支付宝账户 id         值  2  提现到微信账户                 为微信账户 id         值  3  提现到银行卡账户                 为银联账户 id',
  `draw_cash_order_payment_platform_id` varchar(100) NOT NULL COMMENT 'draw_cash_order_payment_platform_id 用户提现业务支付平台反馈的支付平台订单号 对应数据库 draw_cash_order 对应实体类 DrawCashOrder 对应属性 drawCashOrderPaymentPlatformId 数据库字段类型 varchar 实体类字段类型 String 长度 100 取决判定 draw_cash_order_draw_cash_type 用户提现资金去向类型  如 draw_cash_order_draw_cash_type         值  1  提现到支付宝账户                 为支付宝账户 返回的交易订单id         值  2  提现到微信账户                 为微信账户 id返回的交易订单id         值  3  提现到银行卡账户                 为银联账户 id返回的交易订单id',
  `draw_cash_order_payment_platform_feedback` varchar(50) NOT NULL COMMENT 'draw_cash_order_payment_platform_feedback 用户提现业务支付平台反馈的支付平台订单成功与否的标记 draw_cash_order_payment_platform_id附属标记 对应数据库 draw_cash_order 对应实体类 DrawCashOrder 对应属性 drawCashOrderPaymentPlatformFeedback 数据库字段类型 varchar 实体类字段类型 String 长度 100',
  `draw_cash_order_amount` varchar(15) NOT NULL COMMENT 'draw_cash_order_amount 提现订单提现金额 对应数据库 draw_cash_order 对应实体类 DrawCashOrder 对应属性 drawCashOrderAmount 数据库字段类型 varchar 实体类字段类型 String 不可为空 长度  15 数据库中自动初始化为0 设计值为 000  代表 0.00元 使用时,先乘以系数100    将实际金额转换为绝对整数后,进行运算,在运算结束后再除以系数100将换算为实际金额',
  `draw_cash_order_create_time` varchar(20) NOT NULL COMMENT 'draw_cash_order_create_time 充值订单创建时间 对应数据库 draw_cash_order 对应实体类 DrawCashOrder 对应属性 drawCashOrderPaymentPlatformFeedback 数据库字段类型 varchar 实体类字段类型 String 长度 20 由订单初始化时调用时间生成器生成 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  PRIMARY KEY (`draw_cash_order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='draw_cash_order  提现订单 对应实体类 DawCashOder  用户对用户的资金账户的提现订单';

