-- ----------------------------
-- Table structure for fund_account_manage
-- ----------------------------
DROP TABLE IF EXISTS `fund_account_manage`;
CREATE TABLE `fund_account_manage` (
  `fund_account_id` varchar(100) NOT NULL COMMENT 'fund_account_id 资金管理账户 id 数据库表 fund_account_manage 对应实体类 FundAccountManage 属性 fundAccountId; 属性类型 String ,数据库类型 varchar 长度 100 数据库中不自动初始化, 新建账户时由调用生成器生成',
  `cust_id` varchar(100) NOT NULL COMMENT 'cust_id 用户账户编号 这里对应三类用户     type 1) client_user 中的 client_user_id     type 2) parking_manager 中的 parking_manager_id     type 3) handset_manager 中的 handset_manager_id 数据库表 fund_account_manage 对应实体类 FundAccountManage 属性 custId; 属性类型 String ,数据库类型 varchar 长度 100 数据库中不自动初始化, 以此字段与用户表关联 1:1 关系',
  `subaccount_type` varchar(4) NOT NULL COMMENT 'subaccount_type 关联账户号类型 这里对应三类用户     type 1) 终端用户 对应 client_user 使用表中的 client_user_id     type 2) 停车场场主 对应 parking_manager 使用表中的 parking_manager_id     type 3) 手持机管理员 对应 handset_manager使用表中的 handset_manager_id 数据库表 fund_account_manage 对应实体类 FundAccountManage 属性 subaccountType; 属性类型 String ,数据库类型 varchar 长度4 数据库中不自动初始化, 创建账户时,根据实际情况设置',
  `fund_account_manage_amount` varchar(50) NOT NULL DEFAULT '0.00' COMMENT 'fund_account_manage_amount 账户名下总金额 对应 数据库表 fund_account_manage; 对应实体类 FundAccountManage; 属性 fundAccountManageAmount; 属性类型 String ,数据库类型 varchar 长度 15 数据库中自动初始化为0 设计值为 000  代表 0.00元 使用时,先乘以系数100    将实际金额转换为绝对整数后,进行运算,在运算结束后再除以系数100将换算为实际金额',
  `fund_account_manage_property` varchar(1) NOT NULL COMMENT 'fund_account_manage_property 账户性质   type 1   个人用户账户   type 2   企业用户账户 对应 数据库表 fund_account_manage; 对应实体类 FundAccountManage; 属性 fundAccountManageProperty; 属性类型 String ,数据库类型 char 长度1 数据库中不自动初始化,有资金账户建立时初始化设置',
  `fund_account_manage_state` varchar(2) NOT NULL DEFAULT '00' COMMENT 'fund_account_manage_state 账户状态   type 00---生效状态   type 01---冻结   type 02---注销 对应 数据库表 fund_account_manage; 对应实体类 FundAccountManage; 属性 fundAccountManageState; 属性类型 String ,数据库类型 char 长度 2 数据库中自动初始化为 00',
  `fund_account_manage_create_time` varchar(20) NOT NULL COMMENT 'fund_account_manage_create_time 资金账户创建时间 数据库表 fund_account_manage 对应实体类 Fund_account_manage 属性 fundAccountManageCreateTime 属性类型 String ,数据库类型 varchar 长度 20 默认为空,由用户填写 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  PRIMARY KEY (`fund_account_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='fund_account_manage 资金管理账号 类 FundAcountManage 用户账户信息管理核心类 主要管理账户信息 使用外键 foreign_key 指向Id 包括 余额, 上次操作时间 上次资金变动    与终端用户client_user   n:1关系';

-- ----------------------------
-- Records of fund_account_manage
-- ----------------------------

