  `handset_manager_create_time` varchar(20) NOT NULL COMMENT 'handset_manager_create_time 停车场手持机收费员用户账号创建时间 数据库表 handset_manager 对应实体类 HandsetManager 属性 handsetManagerCreateTime; 属性类型 String ,数据库类型 varchar 20 默认为空,停车场手持机收费员用户账号创建时由生成器生成 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  `handset_manager_active_mark` varchar(7) NOT NULL DEFAULT 'enable' COMMENT 'handset_manager_active_mark 停车场手持机收费员用户账号状态 数据库表 handset_manager 对应实体类 HandsetManager 属性 handsetManagerActiveMark 属性类型 Strin g,数据库类型 varchar 长度7 默认为enable可用 enable可用 disable为不可用',
  `handset_id` varchar(100) DEFAULT NULL COMMENT 'handset_id 停车场手持机id 数据库表 handset_manager 对应实体类HandsetManager 属性 handsetId 属性类型 Strin g,数据库类型 varchar 长度100 数据库中不自动初始化, 停车场手持机新建时由调用生成器生成',
  `handset_registr_ation_id` varchar(100) DEFAULT NULL,
  `handset_manager_name` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`handset_manager_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='handset_manager 手持机管理员 对应countManage 用户账户信息管理核心类 主要管理账户信息 使用外键 foreign_key指向Id 包括 余额, 上次操作时间 上次资金变动    与终端用户client_user   n:1关系';

