DROP TABLE IF EXISTS `parking_info`;
CREATE TABLE `parking_info` (
  `parking_info_id` varchar(100) NOT NULL COMMENT 'parking_info_id 停车场id 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoId; 属性类型 String,数据库类型 varchar 长度 100 数据库中不自动初始化, 新建停车场信息时由调用生成器生成',
  `parking_info_name` varchar(100) NOT NULL COMMENT 'parking_info_name 停车场名称 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoName; 属性类型 String ,数据库类型 varchar 长度100 数据库中不自动初始化, 新建停车场信息时由用户设置',
  `parking_info_address` varchar(200) DEFAULT NULL COMMENT 'parking_info_address 停车场地址 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoAddress; 属性类型 String ,数据库类型 varchar 长度200 数据库中不自动初始化, 由用户设置',
  `parking_info_longitude` varchar(50) NOT NULL COMMENT 'parking_info_longitude 停车场经度 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoLongitude; 属性类型 String ,数据库类型 varchar 长度50 不可为空 数据库中不自动初始化,此项字段为添加停车场信息时的必选项',
  `parking_info_latitude` varchar(50) NOT NULL COMMENT 'parking_info_latitude 停车场纬度 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoLatitude; 属性类型 String ,数据库类型 varchar 长度50 不可为空 数据库中不自动初始化,此项字段为添加停车场信息时的必选项',
  `parking_info_parking_spaces` varchar(50) NOT NULL COMMENT 'parking_info_parking_spaces 停车场车位数 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoParkingSpaces; 属性类型 String ,数据库类型 varchar 长度50 不可为空 数据库中不自动初始化,此项字段为添加停车场信息时的必选项',
  `parking_info_rest_parking_spaces` varchar(50) NOT NULL COMMENT 'parking_info_rest_parking_spaces 停车场   剩余     车位数 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoRestParkingSpaces 属性类型 String ,数据库类型 varchar 长度50 不可为空 数据库中不自动初始化,此项字段为添加停车场信息时的必选项 停车场剩余车位数=停车场车位数-停车场现有停车数',
  `parking_info_state` varchar(7) NOT NULL DEFAULT 'enable' COMMENT 'parking_info_state 停车场状态 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoState 属性类型 String ,数据库类型 varchar 长度7 默认为 enable 可用 enable可用 disable为不可用',
  `parking_info_create_time` varchar(20) NOT NULL COMMENT 'parking_info_create_time 停车场注册日期 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoCreateTime 属性类型 String ,数据库类型 varchar 长度20 默认为空,由用户填写 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  `parking_info_create_manager_type` varchar(2) NOT NULL COMMENT 'parking_info_create_manager_type 停车场信息改动人员类型 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoCreateManagerType 属性类型 String ,数据库类型 varchar 长度2 默认为 1 后台管理员 1    后台管理员 2    停车场场主管理员',
  `parking_info_create_manager_id` varchar(50) NOT NULL COMMENT 'parking_info_create_manager_id 停车场信息改动人员id 参照 parking_info_create_manager_type停车场信息改动人员类型 当值 =1 时   为后台管理员id =2 时   为停车场场主管理员id 数据库表 parking_info 对应实体类 ParkingInfo 属性 parkingInfoCreateManagerId 属性类型 String ,数据库类型 varchar 长度100 无默值 ,根据操作停车场信息时,获取操作人员id (新建停车场信息,也算操作,暂定为初始化操作)',
  PRIMARY KEY (`parking_info_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='parking_info 停车场基本信息 对应实体类ParkingInfo 停车场景中停车场对应的模拟对象';

