CREATE TABLE `parking_manager` (
  `parking_manager_id` varchar(100) NOT NULL COMMENT 'parking_manager_id 停车场场主用户账号主键id 数据库表 parking_manager 对应实体类 ParkingManager 属性 parkingManager_phone 属性类型 String ,数据库类型 varchar 长度 100 数据库中不自动初始化, 用户新建账户时由调用生成器生成',
  `parking_manager_phone` varchar(12) NOT NULL COMMENT 'parking_manager_phone 停车场场主手机号 数据库表 parking_manager 对应实体类 ParkingManager 属性 parkingManager_phone 属性类型 String ,数据库类型 varchar 长度12 默认为空,由用户注册时初始化,不允许为空',
  `parking_manager_psd` varchar(100) NOT NULL COMMENT 'parking_manager_psd 停车场场主登录密码 数据库表 parking_manager 对应实体类 ParkingManager 属性 parkingManagerPsd 属性类型 String ,数据库类型 varchar 长度100 默认为空,由用户注册时初始化,不允许为空',
  `parking_info_id` varchar(100) DEFAULT NULL COMMENT 'parking_info_id 停车场场主用户账号关联停车场id 数据库表 parking_manager 对应实体类 ParkingManager 属性 parkingInfoId 属性类型 String ,数据库类型 varchar 长度 100 数据库中不自动初始化, 用户新建账户时由用户手动添加配置关联',
  `parking_manager_create_time` varchar(20) NOT NULL COMMENT 'parking_manager_create_time 停车场场主用户账户创建时间 数据库表 parking_manager 对应实体类 ParkingManager 属性 parkingManagerCreateTime 属性类型 String ,数据库类型 varchar 长度 20 默认为空,停车场场主用户账号创建时由生成器生成 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  `parking_manager_active_mark` varchar(7) NOT NULL DEFAULT 'enable' COMMENT 'parking_manager_active_mark 停车场场主用户账号状态 数据库表 parking_manager 对应实体类 ParkingManager 属性 parkingManagerActiveMark 属性类型 String ,数据库类型 varchar 长度7 默认为enable可用 enable可用 disable为不可用',
  `parking_manager_name` varchar(20) NOT NULL,
  PRIMARY KEY (`parking_manager_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='parking_manager 停车场场主用户数据库表 对应实体类parkingMnager 停车场景中停车场场主对应的模拟对象';

-- ----------------------------
-- Records of parking_manager
-- ----------------------------

-- ----------------------------
-- Table structure for parking_order
-- ----------------------------
DROP TABLE IF EXISTS `parking_order`;
CREATE TABLE `parking_order` (
  `parking_order_id` varchar(100) NOT NULL COMMENT 'parking_order_id 停车订单主键Id 唯一键标识 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderId 数据库字段类型 varchar 实体类字段类型 String 长度50 由停车场端手持机或一体机识别生成',
  `parking_order_car_no` varchar(10) NOT NULL COMMENT 'parking_order_car_no 停车订单中停车场端发现的车牌号 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderCarNo 数据库字段类型 varchar 实体类字段类型 String 长度10 对应 终端用户车辆管理表 clinet_user_car_manage 由停车场端手持机或一体机识别生成',
  `parking_order_car_manage_id` varchar(100) DEFAULT NULL COMMENT 'parking_order_car_manage_id 通过  parking_order_car_no 逻辑查找到的 终端用户部分clinet_user_car_manage 终端用户车辆管理表(实体类ClientUserCarManager) 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderCarManageId 数据库字段类型 varchar 实体类字段类型 String 长度100 对应 逻辑中找出',
  `parking_order_client_user_id` varchar(100) DEFAULT NULL COMMENT 'parking_order_client_user_id 通过  parking_order_car_manage_id 逻辑查找到的 终端用户部分clinet_user 终端用户车辆管理表(实体类ClientUser) 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderClientUserId 数据库字段类型 varchar 实体类字段类型 String 长度100 对应 逻辑中找出',
  `parking_order_car_enter_time` varchar(20) NOT NULL COMMENT 'parking_order_car_enter_time 车辆进入停车场时间 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderCarEnterTime 数据库字段类型 varchar 实体类字段类型 String 长度 20 默认为空,由用户填写 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  `parking_order_car_exit_time` varchar(20) DEFAULT NULL COMMENT 'parking_order_car_exit_time 车辆离开停车场时间 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderCarExitTime 数据库字段类型 varchar 实体类字段类型 String 长度 20 默认为空,由用户填写 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  `parking_order_car_stay_time` varchar(20) DEFAULT NULL COMMENT 'parking_order_car_stay_time 车辆停留在停车场内时间 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderCarStayTime 数据库字段类型 varchar 实体类字段类型 String 长度 10 逻辑字段,不能为空, 单位为秒 在发生计算时,需要进行到分,时,日,月的计算',
  `parking_order_parking_state` varchar(5) NOT NULL DEFAULT 'stay' COMMENT 'parking_order_parking_state 停车订单中车辆在停车场的停车状态 用来标记 是否完成停车 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderParkingState 数据库字段类型 varchar 实体类字段类型 String 长度 10 逻辑字段,不能为空, 取值只有两个字段 stay      表示车辆在停车场中仍处理停留状态 quiet      表示车辆已经不在停车场处于停车状态,车辆已经离开停车场',
  `parking_order_pay_state` varchar(10) DEFAULT 'NoPaid' COMMENT 'parking_order_pay_state 停车订单中车辆在停车场的停车的支付状态 用来标记 车辆停车后时候完成付费 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderPayState 数据库字段类型 varchar 实体类字段类型 String 长度 10 逻辑字段,不能为空, 取值只有两个字段 NoPaid      表示车辆未完成付款 Paid      表示车辆已经完成付款',
  `parking_order_cost` varchar(15) DEFAULT NULL COMMENT 'parking_order_cost 停车订单中车辆在停车场的停车费用 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderCost 数据库字段类型 varchar 实体类字段类型 String 长度  15 数据库中自动初始化为0 设计值为 000  代表 0.00元 使用时,先乘以系数100    将实际金额转换为绝对整数后,进行运算,在运算结束后再除以系数100将换算为实际金额',
  `parking_order_hand_set_id` varchar(100) NOT NULL COMMENT 'parking_order_hand_set_id 停车订单中车辆被识别时使用的手持机id 对应数据库 parking_order 对应实体类 ParkingOrder 对应属性 parkingOrderHandSetId 数据库字段类型 varchar 实体类字段类型 String 长度 100 逻辑字段,不可为空',
