  `trading_order_balance_State` varchar(2) NOT NULL COMMENT 'trading_order_balance_State 支付交易订单付款方,与收款方资金账户变动状态 唯一键标识 对应数据库 trading_order 对应实体类 TradingOrder 对应属性 tradingOrderBalanceState 数据库字段类型 varchar 实体类字段类型 String 默认   00 付款方与收款方均未登记账户变动           01 付款方已经完成登记账户变动,收款方未完成登记账户变动           02 付款方未完成登记账户变动,收款方已完成登记账户变动           03 付款方与收款方均完成登记账户变动',
  `trading_order_tran_amount` varchar(15) NOT NULL COMMENT 'trading_order_tran_amount 支付交易订单j支付金额 对应数据库 trading_order 对应实体类 TradingOrder 对应属性 tradingOrderTranAmount 数据库字段类型 varchar 实体类字段类型 String 长度 15 数据库中自动初始化为0 设计值为 000  代表 0.00元 使用时,先乘以系数100    将实际金额转换为绝对整数后,进行运算,在运算结束后再除以系数100将换算为实际金额',
  `trading_order_create_time` varchar(20) NOT NULL COMMENT 'trading_order_create_time 支付交易订单创建时间 对应数据库 trading_order 对应实体类 TradingOrder 对应属性 tradingOrderCreateTime 数据库字段类型 varchar 实体类字段类型 String 长度 20 由订单初始化时调用时间生成器生成 格式 YYYY-MM-DD hh:mm:ss 年-月-日 时时秒分秒秒 eg:1999-01-01 13:22:22',
  PRIMARY KEY (`trading_order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='trading_orders 交易订单 对应实体类 TradingOders 用户对用户的之间资金账户交易发生变动的订单';

